<html>
<head>
  <script>
function toggle(item)
{
 if (item.style.backgroundColor == 'black') 
 {
  item.style.backgroundColor = 'white'; 
 } else { 
  item.style.backgroundColor = 'black'; 
 }
}
function cellLeft(item)
{
 return item.previousElementSibling;
}
function cellRight(item)
{
 return item.nextElementSibling;
}
function cellAbove(item)
{
 previousRow = item.parentElement.previousElementSibling;
 if (previousRow) {
   above = previousRow.firstElementChild;
   while (above.cellIndex < item.cellIndex)
    above = above.nextElementSibling;
 }
 return(above);
}
function cellBelow(item)
{
 nextRow = item.parentElement.nextElementSibling;
 if (nextRow) {
   below = nextRow.firstElementChild;
   while (below.cellIndex < item.cellIndex)
    below = below.nextElementSibling;
 }
 return(below);
}

function flood(item)
{
 if (item.style.backgroundColor == "yellow") {
  nextColor = "orange"; 
 } else if (item.style.backgroundColor == "orange") {
  nextColor = "red"; 
 } else if (item.style.backgroundColor == "red") {
  nextColor = "blue"; 
 } else if (item.style.backgroundColor == "blue") {
  nextColor = "white";
 } else {
  nextColor = "yellow"; 
 } 
  var todo = new Array();
  var connected = new Array();
  todo.push(item);
  while(todo.length) {
    ex = todo.pop();
    connected.push(ex);
    if (cellLeft(ex) && cellLeft(ex).style.backgroundColor != "black") {
      connected.push(cellLeft(ex));
      if (connected.indexOf(cellLeft(cellLeft(ex))) == -1) {
        todo.push(cellLeft(cellLeft(ex)));
      }
    }
    if (cellRight(ex) && cellRight(ex).style.backgroundColor != "black") {
      connected.push(cellRight(ex));
      if (connected.indexOf(cellRight(cellRight(ex))) == -1) {
        todo.push(cellRight(cellRight(ex)));
      }
    }
    if (cellAbove(ex) && cellAbove(ex).style.backgroundColor != "black") {
      connected.push(cellAbove(ex));
      if (connected.indexOf(cellAbove(cellAbove(ex))) == -1) {
        todo.push(cellAbove(cellAbove(ex)));
      }
    }
    if (cellBelow(ex) && cellBelow(ex).style.backgroundColor != "black") {
      connected.push(cellBelow(ex));
      if (connected.indexOf(cellBelow(cellBelow(ex))) == -1) {
        todo.push(cellBelow(cellBelow(ex)));
      }
    }
 }
  for (var i = 0 ; i < connected.length; i++) {
    connected[i].style.backgroundColor = nextColor;
  }
}
  </script>
